import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar'
import '../css/Navbar.css';
import React, {Component} from 'react';

const _left_list = [
    {id: "home", title: "Hem"},
    {id: "events", title: "Events"},
    {id: "km", title: "Klubbmästeriet"},
    {id: "contact", title: "Kontakt"},
];

const _right_list = [
    {id: "login", title: "Logga in"},
];

class NKM_Navbar extends Component {

    constructor(props){
        super(props);
        this.onSelect = (props.onSelect === undefined) ? (id) => console.log("Navigation selected", id) : props.onSelect;
    }

    render(){
        const left_items = _left_list.map((item) => {
            return ( <Nav.Link key={"nav_"+item.id} onSelect={() => this.onSelect(item.id)} href={"#"+item.id}> {item.title} </Nav.Link> )
        });

        const right_items = _right_list.map((item) => {
            return ( <Nav.Link key={"nav_"+item.id} onSelect={() => this.onSelect(item.id)} href={"#"+item.id}> {item.title} </Nav.Link> )
        });

        const active = window.location.hash.substr(1);

        return (
            <Navbar sticky="top" variant={"dark"}>
                <Navbar.Brand href="#home">Nymbles Klubbmästeri</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav justify variant="tabs" className={"mr-auto"} activeKey={active} defaultActiveKey="#home">
                        { left_items }
                    </Nav>
                    <Nav justify className="justify-content-end" activeKey={active}>
                        { right_items }
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}

export default NKM_Navbar;
